import React from 'react';
import { Link } from 'react-router-dom';

function MemberRow(props) {
    const { member } = props;
    return (
            <tr>
                <td> {member.id}</td>
                <td> {member.nickName}</td>
                <td>{member.firstName}</td>
                <td>{member.lastName}</td>
                <td>{member.dateOfBirth}</td>
            </tr>
    )
}

export default MemberRow;
